import React, { Fragment } from "react";
import { Content } from "../Components/Content";
import { Card } from "react-bootstrap";
import { Image } from "react-bootstrap";
import { NavLink } from "react-router-dom";
function LecturerMyCourses() {
    return (
        <Fragment>
            <Content>
                <div id="lecturerMyCourses">
                    <h3 className="my-4" style={{fontWeight: "600"}}>My Courses</h3>
                    <NavLink to="/LecturerMyCourses" style={{ color: "black" }}>
                        <Card className="cardDashboard p-3" style={{ width: "30%", backgroundColor: "" }}>
                            <Card.Img as={Image} variant="top" src='https://mdbootstrap.com/img/new/standard/nature/184.webp' alt="courses thumbnail"></Card.Img>
                            <Card.Title className="card-title">Machine Learning And Data Analysis</Card.Title>
                            <p className="cardName" style={{ fontSize: "14px", fontWeight: "600", opacity: "0.7" }}>My Courses</p>
                            <p className="cardValue mb-0 d-flex justify-content-end" style={{ fontSize: "28px", fontWeight: "900" }}>13</p>
                        </Card>
                    </NavLink>
                </div>
            </Content>
        </Fragment>
    );
}
export default LecturerMyCourses;
